import React, { Component } from 'react';

class SongList extends Component{
    constructor(props){
        super(props);
    }
    componentDidMount(){
        console.log(this.props);
    }
    render(){
        return(
            <div className="songList">
                <p className="play-all-btn">播放全部</p>
            </div>
        )
    }
}
export default SongList;
